const ipcRenderer = electron && electron.ipcRenderer;
function init(eventName, callback) {
    (ipcRenderer || {}).on(eventName, function(event, arg) {
        callback(arg.toString());
    })
}
init('consoleMsg-log', function(args) {
    console.log(args);
});
init('consoleMsg-error', function(args) {
    console.error(args);
});